journal.notes:
Ticket reject status :
* here are the reasons leading to the decision to reject this ticket :
* initial goal of this ticket are :
** from a business point of view : to provide a common solution to the case of an email that has become invalid, because of a change in a new version of the email validation constraints deployed in production;
** from a technical point of view : to limit as much as possible in the solution : its complexity and "apps specific" changes;
* namely, this request was created from a previous one avoiding "good members" to be blocked by the email validation because of a "too strong 'spam' constraints pushed in production regarding their own specific email" : <pre>
tommasina.spampinato@virgilio.it
mariaelisa.spampinato89@gmail.com
spampima@gmail.com
</pre>
* so the idea is to provide a common solution guiding members in such cases, whatever the reason is because of a "two strong 'spam' constraint" or another constraint;
* yet, from 5 years back experience, such a case has only occured because of a two strong 'spam' constraint for specific member emails, and never because of the others email constraints => so making a solution applying to ANY email constraints is not that much a real requirement from this experience feedback;
* furthermore, the technical analysis made in the previous notes and in the "Dev notes" section of tkt Description, identifies a bunch of potential impacts to be checked, namely on customized email change request scenario, in differnt apps => leading to the identification of duplicated customized code, that should at least be factorized in a bundle to avoid, again duplicating the new code added + multiple branch managment + multiple test scenarios etc...;
* furthermore, a lead/admin talk, lead to consider that the managment of such case only because of the 'spam' constraint, is much less possible after the last fix refusing only email local parts "ending by 'spam'", instead  of "containing  'spam'";
* furthermore, if this 'spam' constraint 'looseness' would sometime authorize "bad 'spam' emails", then a simple alternative would be to disable it again, and manage a whitelist with the authorized 'spam' emails like the ones above => the 5 years back experience confirms that there a not so much such cases, and that a (hashtable based) php array is okay to implement such a basic whitelist;
* so considering that this change :
** is not really mandatory today to solve a real issue;
** and adds :
*** heavy impacts analysis process, 
*** heavy customized duplicated code test coverage of code that should be first factorized,
*** and also some more dependencies of the email validator feature with other services (like session service), which increase its complexity,
* descision is to reject this ticket for now,
* plan the needed customized code refactoring tasks,
* and reconsider it once they are done, and if ever a case not managed by the "whitelist" solution described above would justify it.

_NB : issues #67996 and #67443 have also been discussed with colleagues, and could have pushed to make such a "common solution" to manage existing members in such cases, that is with email having slashes and/or ending with 'spam', but this two request cases asking for a common solution (implictely for any apps), have been rejected after analysis (and/or repurposed with an alternate solution for now)._

