* => alors :
* il faut créer un nouveau tkt "migration #66685 en sf4" et dev/tester cette migration;
* puis pousser #68520 en testing;
* puis pousser ce nouveau tkt en testing;
* et puis :
* si les test de #68520 sont ok, mais que le client n'a pas fini de valider #66685 => meper uniquement #68520;
