#68805 devrait anticiper la correc des return manquant tel que décrit ci-après, mais je laisse qd même cette description à titre de support, des fois que certains soient zappés (et que donc ce tkt de migr ait ce blocage phpstan...) :
* en sf 3, le fait de mettre un "return <integer_status_code>" dans la méthode "execute" n'est pas indiqué dans la doc, du coup il n'y est pas par défaut dans nos Command, mais maintenant : d'une part phpstan bloque le commit (lors du hook de pré-commit), d'autre part la doc sf 4.4 indique de le mettre;
* il faudrait donc en rajouter un par défaut à la fin des "execute" de nos Comand, avec un TODO de refacto, genre :
<pre>
execute (...) {
...;
...;
...;


//default sf4 migration fix of missing return statement in Command :
return 0;
//TODO refactor such a return in other execution branches of this method
// see https://symfony.com/doc/4.4/console.html

}
</pre>
